export class GameModel
{
    GameName: string;
    GameGenre: string;
    GamePrice: number;
    GameReleaseDate: Date;

    constructor(name:string,genre:string,price:number,releaseDate:Date){
      this.GameName = name;
      this.GameGenre = genre;
      this.GamePrice = price;
      this.GameReleaseDate = releaseDate;
    }

    toJSON(){
      return{
        name: this.name,
        genre: this.genre,
        price: this.price,
        releaseDate: this.releaseDate,
      }
    }
}
